00012     public static void HandleFunctionDefinition(
00013         IdentifierToken consumedIdentifierToken,
00014         TypeClauseNode consumedTypeClauseNode,
00015         GenericParametersListingNode? consumedGenericArgumentsListingNode,
00016         CSharpParserModel model)
00017     {
00018         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenAngleBracketToken)
00019         {
00020             var successGenericParametersListingNode = ParseOthers.TryParseExpression(
00021                 SyntaxKind.GenericParametersListingNode,
00022                 model,
00023                 out var genericParametersListingNode);
00024                 
00025             if (successGenericParametersListingNode)
00026                 consumedGenericArgumentsListingNode = (GenericParametersListingNode)genericParametersListingNode;
00027         }
00028     
00029         if (model.TokenWalker.Current.SyntaxKind != SyntaxKind.OpenParenthesisToken)
00030             return;
00031 
00032         var functionArgumentsListingNode = HandleFunctionArguments(model);
00033 
00034         var functionDefinitionNode = new FunctionDefinitionNode(
00035             AccessModifierKind.Public,
00036             consumedTypeClauseNode,
00037             consumedIdentifierToken,
00038             consumedGenericArgumentsListingNode,
00039             functionArgumentsListingNode,
00040             null,
00041             null);
00042 
00043         model.Binder.BindFunctionDefinitionNode(functionDefinitionNode, model);
00044         model.SyntaxStack.Push(functionDefinitionNode);
00045         model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = functionDefinitionNode;
00046 
00047         if (model.CurrentCodeBlockBuilder.CodeBlockOwner is TypeDefinitionNode typeDefinitionNode &&
00048             typeDefinitionNode.IsInterface)
00049         {
00050             // TODO: Would method constraints break this code? "public T Aaa<T>() where T : OtherClass"
00051             var statementDelimiterToken = model.TokenWalker.Match(SyntaxKind.StatementDelimiterToken);
00052 
00053             foreach (var argument in functionDefinitionNode.FunctionArgumentsListingNode.FunctionArgumentEntryNodeList)
00054             {
00055                 if (argument.IsOptional)
00056                     model.Binder.BindFunctionOptionalArgument(argument, model);
00057                 else
00058                     model.Binder.BindVariableDeclarationNode(argument.VariableDeclarationNode, model);
00059             }
00060         }
00061     }
