00063     public static void HandleConstructorDefinition(
00064         TypeDefinitionNode typeDefinitionNodeCodeBlockOwner,
00065         IdentifierToken consumedIdentifierToken,
00066         CSharpParserModel model)
00067     {
00068         var functionArgumentsListingNode = HandleFunctionArguments(model);
00069 
00070         var typeClauseNode = new TypeClauseNode(
00071             typeDefinitionNodeCodeBlockOwner.TypeIdentifierToken,
00072             null,
00073             null);
00074 
00075         var constructorDefinitionNode = new ConstructorDefinitionNode(
00076             typeClauseNode,
00077             consumedIdentifierToken,
00078             null,
00079             functionArgumentsListingNode,
00080             null,
00081             null);
00082 
00083         model.Binder.BindConstructorDefinitionIdentifierToken(consumedIdentifierToken, model);
00084         model.SyntaxStack.Push(constructorDefinitionNode);
00085         model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = constructorDefinitionNode;
00086 
00087         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.ColonToken)
00088         {
00089             _ = model.TokenWalker.Consume();
00090             // Constructor invokes some other constructor as well
00091             // 'this(...)' or 'base(...)'
00092             
00093             KeywordToken keywordToken;
00094             
00095             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.ThisTokenKeyword)
00096                 keywordToken = (KeywordToken)model.TokenWalker.Match(SyntaxKind.ThisTokenKeyword);
00097             else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.BaseTokenKeyword)
00098                 keywordToken = (KeywordToken)model.TokenWalker.Match(SyntaxKind.BaseTokenKeyword);
00099             else
00100                 keywordToken = default;
00101             
00102             while (!model.TokenWalker.IsEof)
00103             {
00104                 // TODO: This won't work because an OpenBraceToken can appear inside the "other constructor invocation"...
00105                 //    ...If one were to skip over this syntax for the time being, it should be done by counting the
00106                 //       matched OpenParenthesisToken and CloseParenthesisToken until it evens out.
00107                 if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken ||
00108                     model.TokenWalker.Current.SyntaxKind == SyntaxKind.EqualsToken)
00109                 {
00110                     break;
00111                 }
00112 
00113                 _ = model.TokenWalker.Consume();
00114             }
00115         }
00116     }
