00119     public static FunctionArgumentsListingNode HandleFunctionArguments(CSharpParserModel model)
00120     {
00121         var openParenthesisToken = (OpenParenthesisToken)model.TokenWalker.Consume();
00122         var functionArgumentEntryNodeList = new List<FunctionArgumentEntryNode>();
00123         var openParenthesisCount = 1;
00124         var corruptState = false;
00125         
00126         while (!model.TokenWalker.IsEof)
00127         {
00128             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenParenthesisToken)
00129             {
00130                 openParenthesisCount++;
00131             }
00132             else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseParenthesisToken)
00133             {
00134                 openParenthesisCount--;
00135                 
00136                 if (openParenthesisCount == 0)
00137                 {
00138                     break;
00139                 }
00140             }
00141             else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken)
00142             {
00143                 break;
00144             }
00145             else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.EqualsToken &&
00146                      model.TokenWalker.Next.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
00147             {
00148                 break;
00149             }
00150             else if (!corruptState)
00151             {
00152                 var tokenIndexOriginal = model.TokenWalker.Index;
00153                 var successTypeClauseNode = ParseOthers.TryParseExpression(SyntaxKind.TypeClauseNode, model, out var typeClauseNode);
00154                 var successName = false;
00155                 
00156                 if (successTypeClauseNode)
00157                 {
00158                     // 'TypeClauseNode' or 'VariableDeclarationNode'
00159                     var successNameableToken = false;
00160                     
00161                     if (UtilityApi.IsConvertibleToIdentifierToken(model.TokenWalker.Current.SyntaxKind))
00162                     {
00163                         var identifierToken = UtilityApi.ConvertToIdentifierToken(model.TokenWalker.Consume(), model);
00164                         successNameableToken = true;
00165                         
00166                         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.EqualsToken)
00167                         {
00168                             // Optional
00169                         }
00170                             
00171                         var variableDeclarationNode = new VariableDeclarationNode(
00172                             (TypeClauseNode)typeClauseNode,
00173                             identifierToken,
00174                             VariableKind.Local,
00175                             false);
00176                         
00177                         var functionArgumentEntryNode = new FunctionArgumentEntryNode(
00178                             variableDeclarationNode,
00179                             optionalCompileTimeConstantToken: null,
00180                             isOptional: false,
00181                             hasParamsKeyword: false,
00182                             hasOutKeyword: false,
00183                             hasInKeyword: false,
00184                             hasRefKeyword: false);
00185                         
00186                         functionArgumentEntryNodeList.Add(functionArgumentEntryNode);
00187                         
00188                         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CommaToken)
00189                             _ = model.TokenWalker.Consume();
00190                             
00191                         if (tokenIndexOriginal < model.TokenWalker.Index)
00192                             continue; // Already consumed so avoid the one at the end of the while loop
00193                     }
00194                     
00195                     if (!successNameableToken)
00196                         corruptState = true;
00197                 }
00198                 else
00199                 {
00200                     corruptState = true;
00201                 }
00202             }
00203 
00204             _ = model.TokenWalker.Consume();
00205         }
00206         
00207         var closeParenthesisToken = default(CloseParenthesisToken);
00208         
00209         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseParenthesisToken)
00210             closeParenthesisToken = (CloseParenthesisToken)model.TokenWalker.Consume();
00211         
00212         return new FunctionArgumentsListingNode(
00213             openParenthesisToken,
00214             functionArgumentEntryNodeList,
00215             closeParenthesisToken);
00216     }
